exports.step = function(input, fileInput) {
    var references = input.properties.map(reference=>{
	return {
							"sys": {
								"type": "Link",
								"linkType": "Entry",
								"id": reference.entry.id
							}
						}
})
    if(!input.properties["en-US"]){
      input.properties = {
        "en-US": []
      }
    }
  if(!input.fields.properties){
	input.fields.properties = {
		"en-US": []
	}
}
input.fields.properties["en-US"] = _.merge(input.properties["en-US"],references)
  return input.fields
};

