exports.step = function(input, fileInput) {
  if (!input.fields.objects) {
    input.fields.objects = {
      "en-US": [
        input.reference
      ]
    }
  } else {
    var match = input.fields.objects["en-US"].find(reference => {
      return JSON.stringify(reference) == JSON.stringify(input.reference)
    })
    if (!match) {
      input.fields.objects["en-US"].push(input.reference)
    }
  }
  return input
};

